import React,{useEffect,useState} from 'react'
import axios from 'axios'

export default function Changes() {
    const [newError,setNewError] = useState(false)
    const [change,setChanges] = useState()

    useEffect(() =>{
        setNewError(false)

        axios({
            method:'GET',
            url: 'http://localhost:5000/inventory/changes'
        })
        .then(res => {
            setChanges(prevInventory =>{
                return [...new Set([...prevInventory,...res.data.map(i => i)])]
            })
        })
        .catch(e =>{
            setNewError(true)
            console.log('Error: '+e)
        })
    },[])
    return {newError,change}
}
